INSERT INTO exam (exam_uuid, content, locked, password, accessible, attachments_filename, content_valid, attachments_migration_started, user_account_id, creation_date, deletion_date, title, content_xml, grading_structure, exam_language, exam_code, exam_period, exam_type) VALUES ('6be69ec8-dd05-4732-89aa-f4fef65f7fc4', NULL, true, 'purkukoodi', false, NULL, true, NULL, '24e2a915-7662-408e-a0e3-2dce706f48b9', '2025-02-14 08:41:07.832388+00', NULL, 'FI – Äidinkieli ja kirjallisuus, kirjoitustaidon koe', '<e:exam xmlns:e="http://ylioppilastutkinto.fi/exam.xsd" xmlns="http://www.w3.org/1999/xhtml" xmlns:xsi="http://www.w3.org/2001/XMLSchema-instance" xsi:schemaLocation="http://ylioppilastutkinto.fi/exam.xsd https://abitti.net/schema/exam.xsd" exam-schema-version="0.5" date="2018-09-19" exam-code="A" day-code="E">    <e:exam-versions>        <e:exam-version lang="fi-FI"/>    </e:exam-versions>    <e:exam-title>FI – Äidinkieli ja kirjallisuus, kirjoitustaidon koe<br/></e:exam-title>    <e:exam-instruction>        <p>Kirjoitustaidon kokeessa kirjoitetaan yksi pohtiva tai kantaa        ottava teksti, jossa hyödynnetään vähintään kahta annetuista        aineistoista. Tekstin sopiva pituus on noin 6 000 merkkiä. Kokeen        enimmäispistemäärä on 60 pistettä.</p>        <p>Tutustu aiheisiin (1–6) ja aineistoihin (A–H). Valitse yksi        aiheista (1–6) ja vähintään kaksi aiheeseen sopivaa aineistoa (A–H).</p>        <p>Rajaa näkökulmasi ja tarkastele aihetta hyödyntämällä tietojasi,        näkemyksiäsi ja valitsemiasi aineistoja. Älä laita otsikoksesi        annettua aihetta, vaan otsikoi tekstisi itse.</p>        <p>Kirjoita tekstisi siten, että lukija voi ymmärtää sen, vaikka ei        tunnekaan aineistoja. Viittaa aineistoihin tarkoituksenmukaisella        tavalla.</p>        <p>Kirjoita tekstisi valitsemasi aiheen kohdalle varattuun tilaan.        Älä jätä muiden aiheiden vastaustiloihin mitään merkintöjä.        Vastaustilaan ei voi liittää kuvakaappauksia.</p>        <p>Jos kirjoitat vastauksesi aluksi LibreOffice-ohjelmalla, muista        tallentaa luonnoksia usein ja siirtää valmis teksti lopuksi        vastaustilaan.</p>        <p>Osa aineistoista on kahdessa tiedostomuodossa, jotta aineistoa        olisi helppo käsitellä. Voit tehdä merkintöjä odt-tiedostoihin        suoraan ja pdf-tiedostoihin Okular-ohjelman avulla.</p>    </e:exam-instruction>    <e:table-of-contents/>    <e:external-material>        <e:attachment>            <e:attachment-title>                Televisiosketsi:                <em>Siskonpeti, Perhe kerääntyy somen ääreen</em>            </e:attachment-title>            <p>Lorem ipsum dolor sit amet consectetur adipisicing elit.            Aspernatur, libero sunt. Eos corporis quam fugiat maiores            expedita quidem quaerat, quos voluptatem similique quae cum.            Voluptate iste sed facere cum omnis.</p>            <e:reference>                <e:author>YTL</e:author>            </e:reference>        </e:attachment>        <e:attachment>            <e:attachment-title>                Artikkeli:                <em>Reetta Räty, Ketä diginatiivi uskoo?</em>            </e:attachment-title>            <p>Lorem ipsum dolor sit amet consectetur adipisicing elit.            Aspernatur, libero sunt. Eos corporis quam fugiat maiores            expedita quidem quaerat, quos voluptatem similique quae cum.            Voluptate iste sed facere cum omnis.</p>            <e:reference>                <e:author>YTL</e:author>            </e:reference>        </e:attachment>        <e:attachment>            <e:attachment-title>                Artikkeli: Tapio Kantele,                <em>Näin sinua ohjataan Facebookissa ja internetissä</em>            </e:attachment-title>            <p>Lorem ipsum dolor sit amet consectetur adipisicing elit.            Aspernatur, libero sunt. Eos corporis quam fugiat maiores            expedita quidem quaerat, quos voluptatem similique quae cum.            Voluptate iste sed fa