INSERT INTO answer (answer_id, answer_paper_id, answer_content, question_id, pregrading_finished_at) VALUES (3, 2, '{"type":"richText","value":"Ympyrä\n\t\t\n\n\t\t<br />Tason pisteet, jotka ovat vakioetäisyydellä  kiinteästä pisteestä, muodostavat ympyrän. Kiinteä  piste on ympyrän keskipiste ja vakioetäisyys sen säde.","characterCount":138}', 3, NULL);
INSERT INTO answer (answer_id, answer_paper_id, answer_content, question_id, pregrading_finished_at) VALUES (4, 2, '{"type":"richText","value":"Keskuskulman kyljet rajaavat ympyrän kehältä kaaren ja ympyrän sisältä sektorin.","characterCount":71}', 4, NULL);
INSERT INTO answer (answer_id, answer_paper_id, answer_content, question_id, pregrading_finished_at) VALUES (5, 3, '{"type":"richText","value":"Lukujonot\n\t\n\t<br /><br />\n\t\t<br />Lukujono <img src=\"/math.svg?latex=(a_%7Bn%7D)\" alt=\"(a_{n})\" /> on aritmeettinen, jos ja vain jos sen kahden peräkkäisen jäsenen erotus on aina sama, eli jos on olemassa sellainen luku <img src=\"/math.svg?latex=d\" alt=\"d\" />, että<br />\n\t\t\n\n\t\tkaikilla positiivisilla kokonaisluvuilla . Erotus <br /><img src=\"/math.svg?latex=a_%7Bn%2B1%7D%E2%88%92a_%7Bn%7D%3Dd\" alt=\"a_{n+1}−a_{n}=d\" /><br />on nimeltään jonon differenssi.<br />\n\t\t\n\n\t\tAritmeettisen jonon <img src=\"/math.svg?latex=(a_%7Bn%7D)\" alt=\"(a_{n})\" />  jäsenet saadaan laskettua, jos tiedetään jonon ensimmäinen jäsen  <img src=\"/math.svg?latex=a_1\" alt=\"a_1\" /> ja jonon differenssi <img src=\"/math.svg?latex=d\" alt=\"d\" />. Silloin kaikilla positiivisilla kokonaisluvuilla <img src=\"/math.svg?latex=n\" alt=\"n\" /> pätee<br /><img src=\"/math.svg?latex=a_n%20%3D%20a_1%2B(n-1)d.\" alt=\"a_n = a_1+(n-1)d.\" />","characterCount":340}', 5, NULL);
INSERT INTO answer (answer_id, answer_paper_id, answer_content, question_id, pregrading_finished_at) VALUES (6, 4, '{"type":"richText","value":"Ennen kokeen alkua\n  \n\n  <br /><br />Käynnistä koneesi USB-muistilta.<br />\n  \n\n  Koneen käynnistyessä näytölle tulee äänitesti. Liitä kuulokkeet tietokoneeseen ja kokeile, saatko äänet kuulumaan.<br />\n  \n\n  \n    Jos äänitestissä on valittavana useita äänilähteitä, kokeile vaihtaa lähdettä.\n    Jos et näe äänilähteitä, sammuta tietokone klikkaamalla näytön \noikean ylänurkan virtanappi-kuvaketta ja käynnistä järjestelmä toisella \nkäynnistysvalikon vaihtoehdolla.\n    Jos et saa koneen pistokemallista äänilähdettä toimimaan, käytä USB-kuulokkeita.<br /><br /><img src=\"/screenshot/d432238c-6a03-4a50-b7bb-e7c09d405f69\" />","characterCount":441}', 5, NULL);
INSERT INTO answer (answer_id, answer_paper_id, answer_content, question_id, pregrading_finished_at) VALUES (7, 4, '{"type":"richText","value":"Kokeeseen kirjautuminen <br /><br />⅓Kirjoita etu- ja sukunimesi niille tarkoitettuun kohtaan.\n      \n        Tarkista, että kirjoitit nimesi oikein.\n        Jos kirjoitit nimesi väärin, pyydä valvoja paikalle.\n      \n    \n    \n      Kirjoita henkilötunnuksesi sille tarkoitettuun kohtaan.\n      \n        Tarkista, että kirjoitit henkilötunnuksen oikein.\n        Jos kirjoitit henkilötunnuksen väärin, pyydä valvoja paikalle.\n      \n    \n    Valitse kokeen kieli (lukiosi opetuskieli) ja koe.\n    Lue ja hyväksy koejärjestelmän käyttöehdot.\n    Odota, että valvoja tulee vahvistamaan kirjautumisesi. \nOdottaessa voit tarkistaa, että näytöllä näkyvät tiedot ovat varmasti \noikein.","characterCount":507}', 6, NULL);
INSERT INTO answer (answer_id, answer_paper_id, answer_content, question_id, pregrading_finished_at) VALUES (8, 4, '{"type":"richText","value":"Näin vastaat<br /><br /> kokeeseen Merkitse vastauksesi sille varattuun tilaan. Koejärjestelmä \ntallentaa vastauskentässä olevat vastauksesi automaattisesti. \nVastauskentän alapuolella näkyy käyttämiesi merkkien määrä. Välilyöntejä\n ja rivinvaihtoja ei lasketa mukaan merkkimäärään. Jos vastauskentän \nmerkkimäärä on rajoitettu ja määrä ylittyy, antaa järjestelmä \nvirheilmoituksen.\n    Voit tehdä muistiinpanoja ja luonnostella vastaustasi \njärjestelmän ohjelmilla tai paperille kokeen aikana. Tallenna ohjelmilla\n tekemäsi tiedostot säännöllisesti, jotta ne varmuuskopioidaan \npalvelimelle. Vastaus täytyy kuitenkin liittää vastauskenttään, jotta se\n arvostellaan.\n    Koevastaukseen voi liittää erikoismerkkejä, matemaattisia kaavoja ja kuvakaappauksia. Ohjeet löytyvät alta.\n    \n      Näin palautat aikaisemman version vastauksesta.\n      \n        Klikkaa vastausikkunan oikeassa alanurkassa näkyvää Aiemmat vastausluonnokset -linkkiä.\n        Voit selailla vastausvaihtoehtoja klikkaamalla vasemmalla näkyvää valikkoa.\n        Jos haluat palauttaa esikatselussa näkyvän vastausvaihtoehdon, klikkaa Palauta-nappia. <br /><br /><img src=\"/screenshot/ef03ad16-c01a-4513-92da-58dfab79fd97\" />","characterCount":943}', 3, NULL);
INSERT INTO answer (answer_id, answer_paper_id, answer_content, question_id, pregrading_finished_at) VALUES (9, 4, '{"type":"richText","value":"Matemaattisten kaavojen lisääminen<br /><br />Tekstivastauskenttiin voi lisätä matemaattisia kaavoja.<br />\n  \n\n  \n    Aktivoi vastausikkuna klikkaamalla sitä.\n    \n      Yksittäisiä matemaattisia merkkejä voi lisätä koesivun ylälaidassa olevasta valikosta:","characterCount":198}', 1, NULL);
INSERT INTO answer (answer_id, answer_paper_id, answer_content, question_id, pregrading_finished_at) VALUES (10, 4, '{"type":"richText","value":"Varsinaisen kaavaeditorin voit avata klikkaamalla koesivun vasemmassa ylänurkassa olevaa Lisää kaava -painiketta.\n    \n      Kaavaa voit kirjoittaa kahdella eri tavalla.\n      \n        Editorin vasemmalle puolelle voit lisätä kaavahahmoja koesivun yläosasta ja täyttää harmaisiin laatikoihin merkintöjä.\n        Editorin oikealla puolella voit muokata kaavaa LaTeX-kuvauskielellä.\n        Kaavaeditori pyrkii päivittämään molempia esitysmuotoja, jos\n toista muokataan. Jos LaTeX-esitysmuotoa ei voida näyttää vasemmalla \nesimerkiksi virheellisen syntaksin mukaan, on vasen puoli valkoinen.\n      \n    \n    Uuden kaavarivin saa painamalla rivinvaihtonäppäintä.\n    Kaava \"suljetaan\" klikkaamalla hiirellä editorin ulkopuolella.\n    Arvostelussa näkyy suljettu sinipohjainen kaava. Jos kaavan tilalla on punainen varoituskolmio, on kaavassa virhe.","characterCount":693}', 4, NULL);
INSERT INTO answer (answer_id, answer_paper_id, answer_content, question_id, pregrading_finished_at) VALUES (11, 4, '{"type":"richText","value":"      Eri kielten vaatimia kirjaimia ja muita erikoismerkkejä voit tuottaa kahdella eri tavalla:\n      \n        Vaihtamalla näppäimistön näppäimistökartan klikkaamalla \nnäytön yläpalkin näppäimistökuvaketta ja valitsemalla haluamasi \nnäppäimistökartan. Käytössä olevan näppäinten sijainnit näet \nsovellusvalikon ohjelmalla “Näppäimistökartta”.\n        Avaamalla koeympäristön ohjeet (näytön vasemman ylänurkan \nkuvake &gt; Koeympäristön ohjeet &gt; Näppäimistö) ja klikkaamalla \nhaluamaasi erikoismerkkiä. Liitä merkki haluamaasi paikkaan \nleikepöydältä painamalla Ctrl ja V.\n      \n    \n    \n\n    Jos poistut paikaltasi kokeen aikana esimerkiksi \nvessaan, kytke näytönsäästäjä päälle klikkaamalla lukon kuvaa näytön \nyläreunassa.","characterCount":595}', 2, NULL);
